  false,\n\t\"url\": null,\n\t\"notes\": \"Municipal Fiscal Indicators is an annual
  compendium of information compiled by the Office of Policy and Management, Intergovernmental
  Policy Division (IGP), Municipal Finance Services Unit (MFS). The data contained
  in Indicators provides key financial and demographic information on municipalities
  in Connecticut. Municipal Fiscal Indicators contains the most current financial
  data available for each of Connecticut's 169 municipalities. The majority of this
  data was compiled from the audited financial statements that are filed annually
  with the State of Connecticut, Office of Policy and Management, IGP Division. This
  database of information includes selected demographic and economic data relating
  to, or having an impact upon, a municipalityu2019s financial condition.\",\n\t\"license_title\":
